import React from 'react'

const HangmanDrawing = () =>{
    return(
        <div style={{position:'relative', border:'solid black 3px', display:'flex', flexDirection:'column', alignItems:'center'}}>
            <div style={{width:'130px', height:'10px', backgroundColor:'black', alignSelf:'end' }}/>
            <div style={{width:'10px', height:'200px', backgroundColor:'black'}}/>
            <div style={{width:'250px', height:'10px', backgroundColor:'black'}}/>
        </div>
    )
}

export default HangmanDrawing
